import React from "react";

class Header extends React.Component {
  dietDropdown = (e) => {
    document.getElementById("dietDropdown").classList.toggle("extend");
  };

  workoutDropdown = (e) => {
    document.getElementById("workoutDropdown").classList.toggle("extend");
  };

  render() {
    return (
      <header id="header">
        <div className="title">
          <a href="#">
            <h1>Fit Progress</h1>
          </a>
          <p>
            Fit Progress is the best platform to help you track your nutrient
            intake along with your workouts.
          </p>
        </div>
        <div className="navbar">
          <ul>
            <li className="bignav">
              <a href="#">Water</a>
            </li>
            <li className="bignav" onClick={this.dietDropdown}>
              Diet &#9660;
            </li>
            <li className="bignav" onClick={this.workoutDropdown}>
              Workout &#9660;
            </li>
            <div id="workoutDropdown" className="workoutDropdown">
              <ul>
                <li>Ingredients</li>
                <li>Dishes</li>
                <li>Meals</li>
              </ul>
              <div id="dietDropdown" className="dietDropdown">
                <ul>
                  <li>Ingredients</li>
                  <li>Dishes</li>
                  <li>Meals</li>
                </ul>
              </div>
            </div>
            <li className="bignav">
              <a href="#" className="signButton">
                Sign In
              </a>
            </li>
            <li className="bignav">
              <a href="#" className="signButton">
                Sign Up
              </a>
            </li>
            <li className="smallnav">&#9776;</li>
          </ul>
        </div>
      </header>
    );
  }
}

export default Header;
